import React, { useState } from 'react'
import Earning from './Card_assets/Earning.png'

const data = [{
    id:1,
    image:'Earning',
    text:'Total earning',
    num:'$13,690',
    percent:'36%'
}    ]


const Ecard = () => {
  return (
    <div>
    {data.map((dataa)=>{
       return(
        <div> 
            <img src={Earning}></img>
        <p>{dataa.text}</p>
        <p>{dataa.num}</p> <span>{dataa.percent}</span>
        <ol>
            <li>Income</li>
            <li>Investment</li>
            <li>Savings</li>
        </ol>
        </div>
    ) } )}
     </div>
     )}

export default Ecard
